// /frontend/src/App.js

import React, { useState } from 'react';
import UploadForm from './components/UploadForm';
import ChatWindow from './components/ChatWindow';
import ResultsDisplay from './components/ResultsDisplay';

function App() {
  const [uploadedImage, setUploadedImage] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null); // Will now be an object
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const [chatKey, setChatKey] = useState(1); // Used to reset the chat window

  const handleAnalyze = async (file) => {
    // Reset the state for a new analysis
    setUploadedImage(file);
    setIsLoading(true);
    setError('');
    setAnalysisResult(null);

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch('http://localhost:5000/api/analyze', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errData = await response.json();
        throw new Error(errData.error || `HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setAnalysisResult(data); // Store the whole result object
      setChatKey(prevKey => prevKey + 1); // Reset the chat window with new context

    } catch (err) {
      console.error("Analysis failed:", err);
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  // Function to reset the entire interface
  const handleClear = () => {
    setUploadedImage(null);
    setAnalysisResult(null);
    setError('');
    setChatKey(prevKey => prevKey + 1);
  };

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center p-4 sm:p-6 lg:p-8">
      <div className="w-full max-w-6xl mx-auto">
        
        <header className="text-center mb-10">
          <h1 className="text-3xl sm:text-4xl font-bold text-gray-800">
            AI X-Ray Diagnosis Assistant
          </h1>
          <p className="mt-2 text-md text-gray-600">
            Upload an X-ray image to get an AI-powered analysis and ask questions.
          </p>
        </header>

        <main className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          
          <div className="bg-white p-6 rounded-lg shadow-md flex flex-col">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-2xl font-semibold text-gray-700">1. Upload & Analyze</h2>
              {/* Show the "Start Over" button only after an analysis */}
              { (uploadedImage || error) && (
                <button 
                  onClick={handleClear}
                  className="text-sm bg-gray-200 hover:bg-gray-300 text-gray-700 font-semibold py-1 px-3 rounded-lg transition-colors"
                >
                  Start Over
                </button>
              )}
            </div>
            
            {/* Conditionally show the upload form or the results */}
            {!analysisResult && !isLoading && !error && <UploadForm onAnalyze={handleAnalyze} isLoading={isLoading} />}
            
            {/* Show an error message if the analysis fails */}
            {error && (
              <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded-lg" role="alert">
                <strong className="font-bold">Analysis Failed: </strong>
                <span className="block sm:inline">{error}</span>
              </div>
            )}
            
            {/* Show the results display during and after analysis */}
            {(isLoading || analysisResult) && (
              <div className="mt-8 flex-grow flex flex-col">
                <h2 className="text-2xl font-semibold text-gray-700 mb-4">2. View Analysis</h2>
                <div className="flex-grow">
                  <ResultsDisplay 
                    uploadedImage={uploadedImage} 
                    analysisResult={analysisResult} 
                    isLoading={isLoading}
                  />
                </div>
              </div>
            )}
          </div>

          <div className="bg-white p-6 rounded-lg shadow-md flex flex-col">
            <h2 className="text-2xl font-semibold text-gray-700 mb-4">3. Ask Questions</h2>
            <div className="flex-grow">
              <ChatWindow 
                key={chatKey} 
                // Pass the full result object as a string for context
                analysisContext={analysisResult ? JSON.stringify(analysisResult, null, 2) : ''} 
              />
            </div>
          </div>

        </main>
      </div>
    </div>
  );
}

export default App;
